import { POST_USER_INFO } from '../Actions/actions';

const initialState = {
    user: {
        username,
        password,
        email
    }
}

export function postUserInfo(state = initialState, action) {
    switch (action.type) {
        case POST_USER_INFO: {
            const { username, email, password } = action.user;
            return {
                ...state,
                user: [...state.user.username, username],
                user: [...state.user.email, email],
                user: [...state.user.password, password]
            }
        }
    }
}
